import React, { useState } from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import bannerImage from '../assets/images/purpleBanner.png';
import '../assets/fonts/Poppins-Regular.ttf';
import '../assets/fonts/Quicksand-Regular.ttf';

const Contact = () => {
    const [formData, setFormData] = useState({
        firstName: '',
        lastName: '',
        email: '',
        topic: '',
        message: '',
    });
    const [isDropdownOpen, setIsDropdownOpen] = useState(false);
    const [hoveredOption, setHoveredOption] = useState(null);

    const dropdownOptions = [
        'Collaborations',
        'Business Partnerships',
        'Sponsorship',
        'Join the Team',
        'Start a Chapter',
        'Other',
    ];

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    const handleDropdownSelect = (option) => {
        setFormData((prevData) => ({ ...prevData, topic: option }));
        setIsDropdownOpen(false); // Close dropdown after selecting
    };

    const handleSubmit = () => {
        console.log('Form Data Submitted:', formData);
    };

    return (
        <div>
            <Header />

            {/* Banner Section */}
            <div style={styles.banner}>
                <h1 style={styles.bannerText}>Contact</h1>
            </div>

            {/* Main Content Section */}
            <div style={styles.contentSection}>
                <h2 style={styles.title}>Get in Touch with Us!</h2>
                <p style={styles.text}>
                    Have any questions or need assistance? We’re here to help. Fill out the form below, and we’ll get back to you as soon as possible.
                </p>

                {/* Contact Form */}
                <div style={styles.formContainer}>
                    {/* First Name */}
                    <div style={styles.inputGroup}>
                        <label style={styles.label}>First Name</label>
                        <input
                            type="text"
                            name="firstName"
                            value={formData.firstName}
                            onChange={handleInputChange}
                            placeholder="Enter First Name"
                            style={styles.inputBox}
                        />
                    </div>

                    {/* Last Name */}
                    <div style={styles.inputGroup}>
                        <label style={styles.label}>Last Name</label>
                        <input
                            type="text"
                            name="lastName"
                            value={formData.lastName}
                            onChange={handleInputChange}
                            placeholder="Enter Last Name"
                            style={styles.inputBox}
                        />
                    </div>

                    {/* Email */}
                    <div style={styles.inputGroup}>
                        <label style={styles.label}>Email</label>
                        <input
                            type="email"
                            name="email"
                            value={formData.email}
                            onChange={handleInputChange}
                            placeholder="Enter Email"
                            style={styles.inputBox}
                        />
                    </div>

                    {/* Topic (Dropdown) */}
                    <div style={styles.inputGroup}>
                        <label style={styles.label}>Topic</label>
                        <div
                            style={styles.dropdownContainer}
                            onClick={() => setIsDropdownOpen(!isDropdownOpen)}
                        >
                            <div style={styles.dropdownSelected}>
                                {formData.topic || 'Select Topic'}
                            </div>
                            {isDropdownOpen && (
                                <div style={styles.dropdownMenu}>
                                    {dropdownOptions.map((option) => (
                                        <div
                                            key={option}
                                            style={{
                                                ...styles.dropdownOption,
                                                ...(hoveredOption === option
                                                    ? styles.dropdownOptionHover
                                                    : {}),
                                            }}
                                            onMouseEnter={() => setHoveredOption(option)}
                                            onMouseLeave={() => setHoveredOption(null)}
                                            onClick={() => handleDropdownSelect(option)}
                                        >
                                            {option}
                                        </div>
                                    ))}
                                </div>
                            )}
                        </div>
                    </div>

                    {/* Message */}
                    <div style={styles.inputGroup}>
                        <label style={styles.label}>Message</label>
                        <textarea
                            name="message"
                            value={formData.message}
                            onChange={handleInputChange}
                            placeholder="Enter Message"
                            style={styles.textareaBox}
                        />
                    </div>

                    {/* Submit Button */}
                    <div style={styles.submitButton} onClick={handleSubmit}>
                        <span style={styles.submitText}>Submit</span>
                    </div>
                </div>
            </div>

            <Footer />
        </div>
    );
};

const styles = {
    banner: {
        width: '100%',
        height: '220px',
        backgroundImage: `url(${bannerImage})`,
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },
    bannerText: {
        color: 'black',
        fontFamily: 'Caprasimo',
        fontSize: '56px',
    },
    contentSection: {
        background: '#F7F5EF',
        padding: '60px 160px',
        textAlign: 'center',
    },
    title: {
        color: '#5A4283',
        fontSize: '32px',
        fontFamily: 'Quicksand',
        fontWeight: '500',
        marginBottom: '20px',
    },
    text: {
        color: 'black',
        fontSize: '16px',
        fontFamily: 'Poppins',
        fontWeight: '500',
        marginBottom: '40px',
    },
    formContainer: {
        width: '100%',
        maxWidth: '600px',
        padding: '24px',
        background: 'white',
        borderRadius: '8px',
        border: '1px solid #C4BAA2',
        display: 'flex',
        flexDirection: 'column',
        gap: '24px',
        margin: '0 auto',
        alignItems: 'flex-start',
        textAlign: 'left',
    },
    inputGroup: {
        alignSelf: 'stretch',
        display: 'flex',
        flexDirection: 'column',
        gap: '8px',
    },
    label: {
        alignSelf: 'stretch',
        color: '#1E1E1E',
        fontSize: '16px',
        fontFamily: 'Poppins',
        fontWeight: '500',
    },
    inputBox: {
        width: '100%',
        padding: '12px 16px',
        borderRadius: '8px',
        border: '1px solid #C4BAA2',
        fontSize: '16px',
        fontFamily: 'Poppins',
    },
    dropdownContainer: {
        position: 'relative',
        cursor: 'pointer',
        borderRadius: '8px',
        border: '1px solid #C4BAA2',
        background: '#F7F5EF',
    },
    dropdownSelected: {
        padding: '12px',
        fontSize: '16px',
        fontFamily: 'Poppins',
        color: 'black',
    },
    dropdownMenu: {
        position: 'absolute',
        top: '100%',
        left: 0,
        width: '100%',
        background: '#F7F5EF',
        borderRadius: '8px',
        boxShadow: '0px 4px 10px rgba(0, 0, 0, 0.1)',
        zIndex: 10,
    },
    dropdownOption: {
        padding: '12px',
        color: 'black',
        fontSize: '12px',
        fontFamily: 'Poppins',
        background: '#F7F5EF',
        borderLeft: '1px solid #C4BAA2',
        borderRight: '1px solid #C4BAA2',
        cursor: 'pointer',
    },
    dropdownOptionHover: {
        background: '#D9F4DA',
    },
    textareaBox: {
        width: '100%',
        padding: '12px 16px',
        borderRadius: '8px',
        border: '1px solid #C4BAA2',
        fontSize: '16px',
        fontFamily: 'Poppins',
        minHeight: '100px',
    },
    submitButton: {
        alignSelf: 'stretch',
        padding: '12px',
        background: '#78B27B',
        borderRadius: '8px',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        cursor: 'pointer',
    },
    submitText: {
        color: 'white',
        fontSize: '16px',
        fontFamily: 'Poppins',
        fontWeight: '500',
    },
};

export default Contact;
